import "./NavBar.css";
import { CardWidget } from "../CardWidget/CardWidget";
import "/imagenes/logo-bm.jpg";

export const NavBar = () => {
  return (
    <div className="contenedorNavBar">
      <p>
        <img src="/imagenes/logo-bm.jpg" alt="" />
      </p>

      <div className="navBar_Items">
        <a href="">Productos</a>
        <a href="">Blog</a>
        <a href="">Contacto</a>
        <a href="">{<CardWidget />}</a>
      </div>
    </div>
  );
};
